import styled from "styled-components";

import { ICoupon } from "@interfaces";

interface IProps {
    data: ICoupon;
}

export const ComponentHistoryCoupon = (props: IProps) => {
    const { data } = props;
    console.log(data);
    return (
        <StyledContainer>
            <div className="coupon">
                <div className="title">Coupon (50% off delivery)</div>
                <div className="date">
                    <span className="status">Collected</span>
                    <span className="time">23 July 2021</span>
                </div>
            </div>
            <div className="quality">+1</div>
        </StyledContainer>
    );
};

const StyledContainer = styled.div`
    padding: 18px 14px;
    display: flex;
    justify-content: space-between;
    align-items: end;
    .coupon {
        .title {
            font-weight: 600;
            font-size: 16px;
            line-height: 21px;
            color: #000000;
            margin-bottom: 4px;
        }
    }
    .date {
        font-weight: normal;
        font-size: 8px;
        line-height: 11px;
        /* identical to box height */

        color: #707070;
    }
`;
